export default function ConfirmedDetail({ url }) {
    const [stats, setStats] = useState();

    useEffect(() => {
        // console.log("Fetching Data");
        async function fetchData() {
            const data = await fetch(url)
                .then(res => res.json())
                .catch(err => {
                    setError(err);
                });
            console.log(data);
            setStats(data);
        }
        fetchData();
    }, []);

    console.log(stats);
}
